import Signup from "./signup/Signup";
import "./App.css";
import { createBrowserRouter } from "react-router-dom";
import Login from "./login/Login";

function App() {
  const route = createBrowserRouter([
    {
      path: "/signup",
      element: <Signup />,
    },
    {
      path: "/login",
      element: <Login />,
    },
  ]);

  return (
  <div className="App">

  </div>);
}

export default App;
